import React from "react"
import {Link} from "react-router-dom";

class CustomerPage extends React.Component{
    render() {
        return(
            <div>
                <Link to={"/"}>
                    <button>Home</button>
                </Link>
                <div>
                    Sign Up: <button>Sign Up</button>
                </div>
                <div>
                    Find Room: <button>Find Room</button>
                </div>
            </div>
        )
    }
}

export default CustomerPage
